import React from 'react';

const EmployeeInfo = () => (
    <>
    <h2>Emplyee Info</h2>
    <p>Photo</p>
    <p>Name</p>
    <p>More info ... total hours, areas allowed to work, etc.</p>
    </>
);

export default EmployeeInfo;
